export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},fCg0QKWrpF:{data:{id:2080,attributes:{imdbId:"tt0036261",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjFmZTI0YzgtMDFjNi00YTJmLWI4NzgtYzVlYjVmMzAzMDliXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"},{Source:"Rotten Tomatoes",Value:"76%"},{Source:"Metacritic",Value:"63\u002F100"}],item_lang:{data:{id:2743,attributes:{title:"Phantom of the Opera",plot:"Pit violinist Claudin hopelessly loves rising operatic soprano Christine Dubois (as do baritone Anatole and police inspector Raoul) and secretly aids her career. But Claudin loses both his touch and his job, murders a rascally music publisher in a fit of madness, and has his face etched with acid. Soon, mysterious crimes plague the Paris Opera House, blamed on a legendary \"phantom\" whom none can find in the mazes and catacombs. But both of Christine's lovers have plans to ferret him out.",slug:"phantom-of-the-opera"}}},books:{data:[{id:10349,attributes:{title:d,description:"The story of the Phantom of the Opera, a half-crazed musician hiding in the labyrinth of the famous Paris Opera House and creating a number of strange and mysterious events to further the career of a beautiful young singer, is today regarded as one of the most famous of all horror stories: widely mentioned in the same breath as Frankenstein and Dracula. Yet the fame of this novel is based almost entirely on the various film versions, while the original book has been largely ignored and is rarely in print. An Accelerated ReaderÂ® Title",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=tPREAQAAMAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"1911-01-01",publisher:a,subtitle:a}},{id:10350,attributes:{title:d,description:"The novel that inspired the Lon Chaney film and the hit musical. \"The wildest and most fantastic of tales.\"--New York Times Book Review.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YXZZDusnE2oC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"1987-12-30",publisher:"Harper Collins",subtitle:a}},{id:10351,attributes:{title:d,description:"The little known, brilliant original text by Gaston Leroux has been immortalized by screen and stage adaptations. One of the greatest horror stories of all time, The Phantom of the Opera makes compulsive reading.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=5oVzPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:"2008-01-01",publisher:"Wordsworth Editions",subtitle:a}},{id:10352,attributes:{title:d,description:"A disfigured musical genius who lives beneath the Paris Opera House falls in love with a beautiful soprano and, in a desperate attempt to have his love returned, takes drastic action.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=jJoOC6HP7DMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:e,published:h,publisher:"Collector's Library",subtitle:a}},{id:10353,attributes:{title:"The Essential Phantom of the Opera",description:"Presents a comprehensive, fully annotated edition about the classic 1911 horror novel about a demented musician who haunts the nineteenth-century Paris Opera House and plays a terrifying role in the career of a beautiful young singer, in an edition that features hundreds of fascinating facts and lore. Reprint.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=F4Zf702Dhl4C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:e,published:h,publisher:"iBooks",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681703512017}}("","Gaston Leroux","movie","The Phantom of the Opera",null,"series",1,"2004-01-01"))